import React, { Component } from 'react';
// import Button from 'react-bootstrap/Button';
import { NavLink } from "react-router-dom";
import "./.css";

export default class JoinUs extends Component {
  render() {
    return (
            <div className="mb-5">
            <section className="hero_contact">
            <div className="container-fluid">
                <div className="row">
                <div className="col-lg-12 col-md-12 col-sm-12 col-xs-12 text-white font-weight-bold mt-5">
                <h1 className="mt-5 display-3"> Will you like to be part of what we do?</h1>
                    <h3 className="display-2 text-success mt-5">Join Us</h3> 
                </div>
                </div>
            </div>
            </section>
            <div className="mt-5 contact-formHeader">
                <p className="h3 text-success">Get results. Join us today</p>
                <p className="h5 text-success">You will never regret it.</p>
            </div>
        <div className="row">
            <div className="col-sm-12 col-md-12 col-lg-4">
             <NavLink to="">
                      <button className="btn btn-success btn-large joinbtn">Farmer</button>
            </NavLink> 
            </div>
            <div className="col-sm-12 col-md-12 col-lg-4">

            </div>
            <div className="col-sm-12 col-md-12 col-lg-4">

            </div>

        </div>


        </div>
    );
  }
}
